import React from "react";
import "./styles.css";

export default function App() {
  return (
    <div>
      <Smiley isHappy />;
      <Smiley isHappy={false} />;
      <Smiley />;
      <Smiley isHappy />;
    </div>
  );
}

function Smiley({ isHappy }) {
  return <h1>{isHappy ? "1" : "0"}</h1>;
}
